import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import "./index.css";
import Bar from "./components/lawkers/bar";
import LawTimeSheet from "./components/lawkers/lawtimesheet.js";
import PayInvoice from "./components/lawkers/payinvoice";
import LawAdd from "./components/lawkers/lawAdd";
import TimeInput from "./components/lawkers/timeinput";
import LawTimeRange from "./components/lawkers/lawtimerange";
import * as serviceWorker from "./serviceWorker";

ReactDOM.render(
  <React.StrictMode>
    <div></div>
  </React.StrictMode>,
  document.getElementById("root")
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
